import React from 'react';
import './componentes.scss';

const Home = () => (
    <div>
    <h1></h1>
    <iframe width="560" height="315" src="https://www.youtube.com/embed/zOmzwCo5LvA" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    <h3>Un recorrido por nuestras <strong>bodegas</strong></h3>
    </div>
)

export default Home;
